script: |
  super -f text -I q993.spq | sort > q993.out

inputs:
  - name: q993.spq
    data: |
      SELECT DISTINCT 93 + + COUNT ( col1 + col0 ) FROM tab0 (FORMAT parquet) WHERE NOT + + col2 NOT BETWEEN - col0 / col1 + + + col0 AND col0 * - - col2 + + col1 + - col1;
  - name: tab0

outputs:
  - name: q993.out
    data: |
      95
